  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143398 includes discrete
  sample and profile data collected from KNORR in the North Atlantic Ocean, North
  Greenland Sea, Norwegian Sea, South Atlantic Ocean and Southern Oceans (> 60 degrees
  South) from 1972-07-18 to 1973-04-01 and retrieved during cruise GEOSECS Atlantic.
  These data include DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON (DIC),
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Potential temperature
  (theta), RADIUM ISOTOPES, SALINITY, TOTAL ALKALINITY (TA), Tritium (Hydrogen isotope),
  WATER TEMPERATURE, phosphate and silicate. The instruments used to collect these
  data include CTD and bottle.nnThese data were collected by Taro Takahashi of Columbia
  University; Lamont-Doherty Earth Observatory and Robert M. Key of Princeton University;
  Department of Geosciences; Program in Atmospheric and Ocean Sciences as part of
  the GEOSECS_Atlantic data set.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
